//  O(n^2)
function popularSymbol(str) {
  let newStr = str.replace(/\s/g, '');
  let ans = '';
  let counter = 0;

  for (let i = 0; i < newStr.length; i++) {
    let currentCounter = 0;

    for (let j = 0; j < newStr.length; j++) {
      if (str[i] === str[j]) {
        currentCounter += 1;
      }
    }

    if (currentCounter > counter) {
      ans = str[i];
      counter = currentCounter;
    }
  }

  return ans;
}
