function popularSymbolOpt(str) {
  let newStr = str.replace(/\s/g, '');
  let ans = '';
  let counter = 0;
  let set = new Set([...newStr]);

  for (let letter of set) {
    let currentCounter = 0;


    for (let j = 0; j < newStr.length; j++) {
      if (letter === str[j]) {
        currentCounter += 1;
      }
    } 

    if (currentCounter > counter) {
      ans = letter;
      counter = currentCounter;
    }
  }

  return ans;
}
