//  O(n + k) k< n => O(n)
function popularSymbolObj(str) {
  let newStr = str.replace(/\s/g, '');
  let ans = '';
  let counter = 0;
  let obj = {};

  for (let i = 0; i < newStr.length; i++) {
    obj[newStr[i]] = obj[newStr[i]] ? obj[newStr[i]] + 1 : 1;
  }

  for (let key in obj) {
    if (obj[key] > counter) {
      counter = obj[key];
      ans = key;
    }
  }

  return ans;
}
